import React, { Component } from "react";
import OneCarCard from "./OneCarCard";
import OneFriendCard from "./OneFriendCard";

export default class Cars extends Component {
    state = {
        myCars:
            [
                {
                    make: "Kia",
                    model: "Sorento",
                    year: 2020
                },
                {
                    make: "Kia",
                    model: "Optima",
                    year: 2019
                },
                {
                    make: "Tesla",
                    model: "Model 3",
                    year: 2021
                },
                {
                    make: "Honda",
                    model: "Civic",
                    year: 2019
                },
                {
                    make: "Honda",
                    model: "Accord",
                    year: 2018
                },
                {
                    make: "Volkswagen",
                    model: "Jetta",
                    year: 2021
                },
                {
                    make: "Toyota",
                    model: "Camry",
                    year: 2021
                },
                {
                    make: "Ford",
                    model: "Mustang",
                    year: 2019
                },
                {
                    make: "Ford",
                    model: "F-150",
                    year: 2019
                },
                {
                    make: "Toyota",
                    model: "Camry",
                    year: 2020
                },
                {
                    make: "Ford",
                    model: "F-150",
                    year: 2021
                }
            ]
    }
    componentDidMount() {
        this.mappedCars()
    }

    mappedCars = () => {
        this.state.myCars.map(this.mapCar)
        return this.mappedCars;
    }

    mapCar = (oneCar) => {
        return (
            <OneCarCard
                make={oneCar.make}
                model={oneCar.model}
                year={oneCar.year}
            />
        )
    }


    render() {
        return (
            <div>
                <h1>This is cars</h1>
                <div className="col-md-12 p-5">
                    <hr />
                    <div className="row">
                        {this.mappedCars}


                    </div>

                </div>
            </div>
        )
    }
}
